window.bookSummaryJSON = "<p><b>A twenty-four-year-old woman trapped in a fantasy role-playing game continues her quest for a way out in this epic adventure for fans of </b><b><i>Dungeons &amp; Dragons</i></b><b>.</b></p> <p>Seven strangers have been snatched from their average lives on Earth and transported to another realm. Now they’re Champions in the Great Game—legendary heroes destined for a higher purpose that will change the world. Speaking of purpose, Kandis Hammond, a junior financial research analyst from Sydney, sure would like to figure out what hers is.</p> <p>Kandis has a come a long way since her arrival in Latorra. She’s a level-four Phantasmal Artificer with high charisma and a team of fellow adventurers. Together, they set up a home base in the city of Talnier and hunt monsters to rack up experience points, wealth, supplies, and more. But Kandis can’t continue like this forever. She has some burning questions that require answers . . .</p> <p>As a Champion, Kandis must determine which god brought her to Latorra so she may take up their cause. Not doing so could have dire consequences. There’s also the matter of what to do with her mysterious Dungeon core. And on top of everything, another Champion is about to show up in Talnier. The newcomer <i>might</i> be an ally, but when Kandis sees who else is riding in their party, her hopes will go up in smoke.</p> <p><b>The second volume of the hit LitRPG fantasy series—with more than 600,000 views on Royal Road—now available on Kindle, Kindle Unlimited, and Audible!</b></p>"; 
